Subito dopo il tag </body> e subito prima del tag </html>, nella penultima riga insomma, aggiungiamo il codice che ci serve. Prima di tutto scarichiamo ed importiamo una libreria JavaScript che ci semplificherà molto la vita e chi si chiama JQuery . Potete scaricare il file direttamente cliccando con il tasto destro qui e scegliendo "Salva link come" o qualcosa di simile. Salvate il file sempre nella cartella di progetto. Quindi aggiungiamo la seguente riga: <script src="jquery-3.4.1.min.js"></script> OK, abbiamo importato la libreria. Ora dobbiamo prendere i dati dal web server. Lo facciamo scrivendo subito dopo un nostro pezzo di codice all'interno del tag <script>. <script> // Prende i dati come JSON dall'URL // quando ha finito di prendere i dati, chiama la funzione "makeList" $.getJSON("http://127.0.0.1:5000/").done(makeList);
</script> Attenzione a quello che succede. Il codice dentro il tag script è JavaScript. Il simbolo del dollaro ($) indica che stiamo usando la libreria JQuery che abbiamo importato subito prima. Quando i dati sono stati completamente ricevuti (ci potrebbe volere del tempo, se i libri fossero molti), viene chiamata la funzione makeList, che dobbiamo ancora definire. Subito dopo la riga precedente, creiamo ora la funzione makeList: function makeList(jsonBooks) { for (book of jsonBooks) { let newItem = `<li>${book}</li>`; $("ul").append(newItem); }
} Vediamo cosa abbiamo fatto. Nella prima riga abbiamo creato una funzione con la keyword function; la funzione prende in input un parametro che gli viene passato da JQuery quando i dati sono stati ricevuti. Subito dopo c'è un ciclo for, molto simile a quello del Python, con qualche differenza: JavaScript usa le parentesi dopo la keyword for JavaScript usa la keyword of invece che in per iterare all'interno di una lista JavaScript usa le parentesi graffe per contenere il corpo del for All'interno del for, nella prima riga creiamo il nuovo item che vogliamo andare ad aggiungere alla lista. Nella riga successiva, c'è un istruzione che dice: usando JQuery ($), seleziona la lista non ordinata (ul) all'interno della lista, aggiungi alla fine (append) il nuovo elemento appena creato Il codice finale di tutta la pagina verrà come segue: <!DOCTYPE html>
<html lang="it">
<head> <meta charset="UTF-8"> <meta name="viewport" content="width=device-width, initial-scale=1.0"> <meta http-equiv="X-UA-Compatible" content="ie=edge"> <title>Biblioteca scolastica</title>
</head>
<body> <ul> </ul> </body>
<script src="jquery-3.4.1.min.js"></script>
<script> // Prende i dati come JSON dall'URL // quando ha finito di prendere i dati, chiama la funzione "makeList" $.getJSON("http://127.0.0.1:5000/").done(makeList); function makeList(jsonBooks) { for (book of jsonBooks) { let newItem = `<li>${book}</li>`; $("ul").append(newItem); }
}
</script>
</html>
